script: |
  super -f text -I q5189.spq | sort > q5189.out

inputs:
  - name: q5189.spq
    data: |
      SELECT ( col1 ) AS col1 FROM tab1 (FORMAT parquet) WHERE NOT + col1 BETWEEN - CAST ( + col1 AS INTEGER ) AND - 27 / col1 + + col1;
  - name: tab1

outputs:
  - name: q5189.out
    data: |
      14
      5
